    render()
    {
        return(
            <div className="formDiv">

                <center>
                    <form method="POST">

                        <table>
                            <tr> <td>Email:</td>     <td> <input type="text"/></td>  </tr>

                            <tr> <td> &nbsp; </td>      <td> &nbsp; </td>  </tr>

                            <tr> <td>Password:</td>       <td> <input type="password"/></td>  </tr>

                            <tr> <td> &nbsp; </td>      <td> &nbsp; </td>  </tr>

                            <tr> <td> &nbsp; </td>   <td><input type="submit"/></td>    <td> &nbsp; </td>  </tr>
                        </table>


                    </form>
                </center>         

            </div>
        );
    }
}
